import React from "react";

const Hello = () => (
    <div>
        <h1>Title of Page</h1>
        <h2>This page is a test</h2>
        <ul>
            <li>Food</li>
            <li>Sports</li>
        </ul>
    </div>

);
   
export default Hello;
